	<script>
	var canvas, stage, exportRoot, anim_container, dom_overlay_container, fnStartAnimation;
	function init() {
		canvas = document.getElementById("canvas");
		anim_container = document.getElementById("animation_container");
		dom_overlay_container = document.getElementById("dom_overlay_container");
		handleComplete();
	}
	function handleComplete() {
		//This function is always called, irrespective of the content. You can use the variable "stage" after it is created in token create_stage.
		exportRoot = new lib.CCKMCCA3_22a();
		stage = new createjs.Stage(canvas);
		stage.addChild(exportRoot);
		stage.enableMouseOver();	
		//Registers the "tick" event listener.
		fnStartAnimation = function() {
			createjs.Ticker.setFPS(lib.properties.fps);
			createjs.Ticker.addEventListener("tick", stage);
		}	    
		//Code to support hidpi screens and responsive scaling.
		function makeResponsive(isResp, respDim, isScale, scaleType) {		
			var lastW, lastH, lastS=1;		
			window.addEventListener('resize', resizeCanvas);		
			resizeCanvas();		
			function resizeCanvas() {			
				var w = lib.properties.width, h = lib.properties.height;
				var iw = window.innerWidth, ih=window.innerHeight;	
				var pRatio = window.devicePixelRatio || 1, xRatio=iw/w, yRatio=ih/h, sRatio=1;
				if(isResp) {                
					if((respDim=='width'&&lastW==iw) || (respDim=='height'&&lastH==ih)) {
						sRatio = lastS;
					}
					else if(!isScale) {
						if(iw<w || ih<h)
							sRatio = Math.min(xRatio, yRatio);				
					}				
					else if(scaleType==1) {					
						sRatio = Math.min(xRatio, yRatio);				
					}				
					else if(scaleType==2) {					
						sRatio = Math.max(xRatio, yRatio);				
					}			
				}			
				canvas.width = w*pRatio*sRatio;			
				canvas.height = h*pRatio*sRatio;
				canvas.style.width = dom_overlay_container.style.width = anim_container.style.width =  w*sRatio+'px';				
				canvas.style.height = anim_container.style.height = dom_overlay_container.style.height = h*sRatio+'px';
				stage.scaleX = pRatio*sRatio;			
				stage.scaleY = pRatio*sRatio;			
				lastW = iw; lastH = ih; lastS = sRatio;		
			}
		}

		TestMetadata = function() {
			Answers = [
		    	"Four",
		    	"Six",
		    	"One"
			];

			Answer = "One";  

		    this.getAnswers = function() {
		      return Answers;
		    };
		  
		    this.getAnswer = function() {		      
		      return Answer;
		    };

		};
		testMetadata = new TestMetadata();

		// Code for adding answers
		function addAnswers(stage) {
			//Drag Object Size
			dragRadius = 40;
			//Destination Size
			destHeight = 100;
			destWidth = 200;

		    var box = new createjs.Shape();
		    box.graphics.setStrokeStyle(2).beginStroke("black").rect(0, 0, destWidth, destHeight);
		    box.setBounds(0, 0, destWidth, destHeight);
		    var destination = new createjs.Container();

		    destinationX = stage.canvas.clientWidth * 2 * 0.70; //(stage.canvas.clientWidth * 2); //* 0.75;// 400;
		    destinationY = stage.canvas.clientHeight * 2 * 0.50; //(stage.canvas.clientHeight); //* 0.75;//200;
		    destination.x = destinationX;
		    destination.y = destinationY;

		    // WHY!!!!????
		    destination.setBounds(1200, 540, 130, 10);


		    destination.addChild(box);

		    stage.addChild(destination);
		    
		    //*** Answers
  			var offset = (stage.canvas.clientWidth) / (testMetadata.getAnswers().length * 2)
  			testMetadata.getAnswers().forEach(function(value, i) {

    			var label = new createjs.Text(value, "24px Lato", "#000");
    			label.textAlign="center";

    			label.y -= 10;
  				var textRect = new createjs.Shape();

  				var labelHeight = label.getBounds().height;
  				var labelWidth = label.getBounds().width;

		    	textRect.graphics.setStrokeStyle(2).beginStroke("black").beginFill('white').rect(-labelWidth,-labelHeight,labelWidth*2,labelHeight*2);

    			var dragger = new createjs.Container();
    			dragger.x = offset * (i*2 + 1) * 2;
    			dragger.y = 380;
    			dragger.addChild(textRect, label);
    			dragger.setBounds(100, 100, dragRadius, dragRadius);

    			//-------
    			dragger.on("pressmove", function(evt) {
					evt.currentTarget.x = evt.stageX / stage.scaleX;
				    evt.currentTarget.y = evt.stageY / stage.scaleY;
				    stage.update(); //much smoother because it refreshes the screen every pixel movement instead of the FPS set on the Ticker
				    if(intersect(evt.currentTarget, destination)){				    
			        	evt.currentTarget.alpha=0.2;
			       		box.graphics.clear();
			        	box.graphics.setStrokeStyle(3).beginStroke("#FF1111").rect(0, 0, destWidth, destHeight);			       
			        } else{
			        	evt.currentTarget.alpha=1;
			        	box.graphics.clear();     
			       		box.graphics.setStrokeStyle(2).beginStroke("black").rect(0, 0, destWidth, destHeight);
			        }
				});

				dragger.on("pressup", function(evt) {
					if(intersect(evt.currentTarget, destination)) {
				      dragger.x = destination.x + destWidth/2;
				      dragger.y = destination.y + destHeight/2;

				      dragger.alpha = 1;
				      box.graphics.clear();     
				      box.graphics.setStrokeStyle(2).beginStroke("black").rect(0, 0, destWidth, destHeight);
				      stage.update(evt);

				      answerIs(evt.currentTarget.children[1].text);

				    }
				});
				stage.addChild(dragger);
			});
		}

		function intersect(obj1, obj2) {
		    var objBounds1 = obj1.getBounds().clone();
		    var objBounds2 = obj2.getBounds().clone();

		    var pt = obj1.globalToLocal(objBounds2.x, objBounds2.y);

		    var h1 = -(objBounds1.height / 2 + objBounds2.height);
		    var h2 = objBounds2.width / 2;
		    var w1 = -(objBounds1.width / 2 + objBounds2.width);
		    var w2 = objBounds2.width / 2;

		    if(pt.x > w2 || pt.x < w1) return false;
		    if(pt.y > h2 || pt.y < h1) return false;
		    
		    return true;
		}

		function answerIs(answer) {



			if (answer == "One") {
				$("#responseJSON").html("Correct");
			} else {
				$("#responseJSON").html("Incorrect");
			}	
		}

		addAnswers(stage);
		
		makeResponsive(true,'both',false,2);	
		fnStartAnimation();
		 
	}
	</script>
